import React, {useState} from "react"
import './App.css';

function App() {
  const {isModalVisible, setIsModalVisible} = useState(false)
  return (
    <div className="App">
      <button onClick = {setIsModalVisible(true)}>Open</button>
      {isModalVisible }
    </div>
  );
}

export default App;
